const Deal = () =>{

    const [fırsatListe,setFırsatListe] = useState([])

    useEffect(() =>{
        const api_link="https://www.cheapshark.com/api/1.0/deals?storeID=1"
        fetch(api_link)
        .then(fl=>fl.json())
        .then(fl=>{
            setFırsatListe(fl)
        })
    })


    return(
        <div>
            USTUNE BASINCA FIRSAT LİSTESİ GÖRINVRCEK
        </div>
    )
}

export default Deal;
